import React, { useState } from 'react';
import './ContactForm.css';

const ContactForm = () => {
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [email, setEmail] = useState('');
  const [phoneNumber, setPhoneNumber] = useState('');
  const [errors, setErrors] = useState({});
  const [successMessage, setSuccessMessage] = useState('');

  const handleInputChange = (event) => {
    const { name, value } = event.target;

    if (name === 'firstName') {
      setFirstName(value);
    } else if (name === 'lastName') {
      setLastName(value);
    } else if (name === 'email') {
      setEmail(value);
    } else if (name === 'phoneNumber') {
      setPhoneNumber(value);
    }
  };

  const handleSubmit = (event) => {
    event.preventDefault();

    const validationErrors = validateForm();

    if (Object.keys(validationErrors).length === 0) {
      // Form submission logic goes here (e.g., API call, etc.)
      console.log('Form submitted successfully!');
      setSuccessMessage('Form submitted successfully!');
      setFirstName('');
      setLastName('');
      setEmail('');
      setPhoneNumber('');
      setErrors({});
    } else {
      console.log('Form has errors. Please fix them.');
      setSuccessMessage('');
      setErrors(validationErrors);
    }
  };

  const validateForm = () => {
    const validationErrors = {};

    if (!firstName.trim()) {
      validationErrors.firstName = 'First name is required';
    }

    if (!lastName.trim()) {
      validationErrors.lastName = 'Last name is required';
    }

    if (!email.trim()) {
      validationErrors.email = 'Email is required';
    } else if (!/\S+@\S+\.\S+/.test(email)) {
      validationErrors.email = 'Invalid email format';
    }

    if (!phoneNumber.trim()) {
      validationErrors.phoneNumber = 'Phone number is required';
    } else if (!/^\d{10}$/.test(phoneNumber)) {
      validationErrors.phoneNumber = 'Invalid phone number format';
    }

    return validationErrors;
  };

  return (

    <div className="container d-flex justify-content-center">
      <div className="col-md-8">
        <div className="row justify-content-center">
          <h1 className="mani">Contact Form</h1>
        </div>
        <form onSubmit={handleSubmit} className="TejuS" >
          <div className="form-group">
            <label>First Name:</label>
            <input
              type="text"
              name="firstName"
              value={firstName}
              onChange={handleInputChange}
              className={`form-control ${errors.firstName ? 'is-invalid' : ''}`}
            />
            {errors.firstName && <div className="invalid-feedback">{errors.firstName}</div>}
          </div>

          <div className="form-group">
            <label>Last Name:</label>
            <input
              type="text"
              name="lastName"
              value={lastName}
              onChange={handleInputChange}
              className={`form-control ${errors.lastName ? 'is-invalid' : ''}`}
            />
            {errors.lastName && <div className="invalid-feedback">{errors.lastName}</div>}
          </div>

          <div className="form-group">
            <label>Email:</label>
            <input
              type="email"
              name="email"
              value={email}
              onChange={handleInputChange}
              className={`form-control ${errors.email ? 'is-invalid' : ''}`}
            />
            {errors.email && <div className="invalid-feedback">{errors.email}</div>}
          </div>

          <div className="form-group">
            <label>Phone Number:</label>
            <input
              type="text"
              name="phoneNumber"
              value={phoneNumber}
              onChange={handleInputChange}
              className={`form-control ${errors.phoneNumber ? 'is-invalid' : ''}`}
            />
            {errors.phoneNumber && <div className="invalid-feedback">{errors.phoneNumber}</div>}
          </div>

          {Object.keys(errors).length > 0 && (
            <div className="alert alert-danger mt-3">Please fix the errors in the form</div>
          )}

          {successMessage && <div className="alert alert-success mt-3">{successMessage}</div>}

          <button type="submit" className="btn btn-primary mt-3">Submit</button>
        </form>
      </div>
    </div>
  );
};

export default ContactForm;
